import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  // state：状态
  state: {
    count: 0
  },
  // mutations可以改变状态的方法集
  mutations: {
    increase () {
      console.log('increase')
      this.state.count = this.state.count + 1
    }
  },
  actions: {

  }
})
